(1471, 'behavior_definition', 75, 'tw', '運用人際溝通技巧，以尊重、同理心與顧客建立良好的互動與關係。'),
(1472, 'behavior_definition', 75, 'cn', ''),
(1473, 'behavior_definition', 75, 'en', ''),
