(1490, 'behavior_definition', 81, 'cn', ''),
(1491, 'behavior_definition', 81, 'en', ''),
(1492, 'behavior_definition', 82, 'tw', '能讓部屬接受領導者的理念、目標或工作分派。'),
(1493, 'behavior_definition', 82, 'cn', ''),
(1494, 'behavior_definition', 82, 'en', ''),
(1495, 'behavior_definition', 83, 'tw', '能建立團隊目標，並帶領部屬完成其工作任務，是個可信賴的領導者。'),
(1496, 'behavior_definition', 83, 'cn', ''),
(1497, 'behavior_definition', 83, 'en', ''),
(1498, 'behavior_definition', 84, 'tw', '能根據現況、資源及醫院價值觀，制定目標、決策，並規劃系列的行動方案。'),
(1499, 'behavior_definition', 84, 'cn', ''),
(1500, 'behavior_definition', 84, 'en', ''),
(1501, 'behavior_definition', 85, 'tw', '能蒐集決策所需資訊，提出各種可能方案，並依據決策標準，考量相關主管、部屬意見，適時選擇有效方案，加以執行。'),
(1502, 'behavior_definition', 85, 'cn', ''),
(1503, 'behavior_definition', 85, 'en', ''),
(1504, 'behavior_definition', 86, 'tw', '能依醫院決策提出方案，並要求所屬單位依據決策標準有效執行，以達成醫院的願景與目標。'),
(1505, 'behavior_definition', 86, 'cn', ''),
(1506, 'behavior_definition', 86, 'en', ''),
(1507, 'behavior_definition', 87, 'tw', '能依部屬的職權範圍授與自我管理的權力，讓他們朝組織目標發展。'),
(1508, 'behavior_definition', 87, 'cn', ''),
(1509, 'behavior_definition', 87, 'en', ''),
(1510, 'behavior_definition', 88, 'tw', '在部屬的授權範圍內，能尊重他人所做的決定，並適時提供諮詢，協助其成長，以達成目標。'),
(1511, 'behavior_definition', 88, 'cn', ''),
(1512, 'behavior_definition', 88, 'en', ''),
(1513, 'behavior_definition', 89, 'tw', '規劃或執行團隊工作時，能從醫院或部門單位的整體利益考量著想。'),
(1514, 'behavior_definition', 89, 'cn', ''),
(1515, 'behavior_definition', 89, 'en', ''),
(1516, 'behavior_definition', 90, 'tw', '能尊重團隊成員意見，支持團隊決定，共同合作達成團隊目標。'),
(1517, 'behavior_definition', 90, 'cn', ''),
(1518, 'behavior_definition', 90, 'en', ''),
(1519, 'behavior_definition', 91, 'tw', '在團隊合作過程中，會主動積極地排除困難，並且提供有益於最後問題解決的方案。'),
(1520, 'behavior_definition', 91, 'cn', ''),
(1521, 'behavior_definition', 91, 'en', ''),
(1522, 'behavior_definition', 92, 'tw', '能視工作需要與其他部門建立良好團隊關係，協同合作，以達成團隊合作的目標。'),
(1523, 'behavior_definition', 92, 'cn', ''),
(1524, 'behavior_definition', 92, 'en', ''),
(1525, 'behavior_definition', 93, 'tw', '能主動提出有助於跨團隊合作衝突的排除或是團隊士氣的激勵方法，以達成組織目標。'),
(1526, 'behavior_definition', 93, 'cn', ''),
(1527, 'behavior_definition', 93, 'en', ''),
(1528, 'competency_definition', 101, 'tw', '能正確同理他人的感受、需要和觀點，並能清楚表達自己的語意讓對方明瞭；以及具備對內、外部顧客的工作說明，以達成團體協作結果的能力。'),
(1529, 'competency_definition', 101, 'cn', ''),
(1530, 'competency_definition', 101, 'en', ''),
(1531, 'competency_definition', 102, 'tw', '能夠運用組織各種相關資源，透過標準作業流程，將策略或計畫有效落實，達到組織既定的目標；有效的管理時間和資源，確保工作有效率的完成。'),
(1532, 'competency_definition', 102, 'cn', ''),
(1533, 'competency_definition', 102, 'en', ''),
(1534, 'competency_definition', 103, 'tw', '整合與管理部屬/同事與自己之間工作關係的互動，並主動維繫與建立對醫院有益的人際網絡。'),
(1535, 'competency_definition', 103, 'cn', ''),
(1536, 'competency_definition', 103, 'en', ''),
(1537, 'competency_definition', 104, 'tw', '能依部屬能力授予適當權力，清楚說明授權範圍，並尊重部屬所做的決定，且適時提供指導。'),
(1538, 'competency_definition', 104, 'cn', ''),
(1539, 'competency_definition', 104, 'en', ''),
(1540, 'competency_definition', 105, 'tw', '蒐集決策所需資訊，提出各種可能方案，依據職權範圍並參酌相關人員意見，適時選擇有效方案，加以執行。'),
(1541, 'competency_definition', 105, 'cn', ''),
(1542, 'competency_definition', 105, 'en', ''),
(1543, 'competency_definition', 106, 'tw', '能蒐集、整合及有效運用不同來源的資料，以統計工具或經驗針對議題進行邏輯性、系統性的分析，以找出決策或問題解決的方案。'),
(1544, 'competency_definition', 106, 'cn', ''),
(1545, 'competency_definition', 106, 'en', ''),
(1546, 'behavior_definition', 94, 'tw', '處事圓融，能視不同狀況調整溝通技巧，以與他人溝通。'),
(1547, 'behavior_definition', 94, 'cn', ''),
(1548, 'behavior_definition', 94, 'en', ''),
