(2005, 'competency_definition', 117, 'tw', '能夠根據組織的價值及使命，塑造整體組織成員所應共同具有的期望，並能向組織成員清楚的表達該共同的期望所涉及的意義。'),
(2006, 'competency_definition', 117, 'cn', ''),
(2007, 'competency_definition', 117, 'en', ''),
(2008, 'behavior_definition', 154, 'tw', '熟悉公司的產品和服務特性，知道公司目前的策略定位及未來的走向。'),
(2009, 'behavior_definition', 154, 'cn', ''),
(2010, 'behavior_definition', 154, 'en', ''),
(2011, 'behavior_definition', 155, 'tw', '隨時留意產業動態及變化，對產業的未來趨勢，能提出明確的判斷和分析。'),
(2012, 'behavior_definition', 155, 'cn', ''),
(2013, 'behavior_definition', 155, 'en', ''),
(2014, 'behavior_definition', 156, 'tw', '瞭解企業的優、劣勢及擁有那些資源可供運用。'),
(2015, 'behavior_definition', 156, 'cn', ''),
(2016, 'behavior_definition', 156, 'en', ''),
(2017, 'behavior_definition', 157, 'tw', '規劃的策略內容需涵蓋部門的策略目標及資源整合綜效。'),
(2018, 'behavior_definition', 157, 'cn', ''),
(2019, 'behavior_definition', 157, 'en', ''),
(2020, 'behavior_definition', 158, 'tw', '擬定的策略符合企業的願景與使命，並能明確勾勒出企業未來實踐的藍圖。'),
(2021, 'behavior_definition', 158, 'cn', ''),
(2022, 'behavior_definition', 158, 'en', ''),
(2023, 'behavior_definition', 159, 'tw', '決策時能利用資源找出兩個以上的方案，並比較其優缺點而選擇較佳的一個行動方案。'),
(2024, 'behavior_definition', 159, 'cn', ''),
(2025, 'behavior_definition', 159, 'en', ''),
(2026, 'behavior_definition', 160, 'tw', '儘管資源有限，還是可以找出一個以上的不同的解決方案。'),
(2027, 'behavior_definition', 160, 'cn', ''),
(2028, 'behavior_definition', 160, 'en', ''),
(2029, 'behavior_definition', 161, 'tw', '決策時能進行分析並預測其可能對各部門產生的影響與結果進而選擇最佳的一個行動方案。'),
(2030, 'behavior_definition', 161, 'cn', ''),
(2031, 'behavior_definition', 161, 'en', ''),
(2032, 'behavior_definition', 162, 'tw', '在進行決策思考時，會考慮到決策方案與其他單位發展議題所產生的連動關係。'),
(2033, 'behavior_definition', 162, 'cn', ''),
(2034, 'behavior_definition', 162, 'en', ''),
(2035, 'behavior_definition', 163, 'tw', '在進行決策時會考量與其他相關企業發展的議題及所有影響情況後，做出決策，達到最大綜效。'),
(2036, 'behavior_definition', 163, 'cn', ''),
(2037, 'behavior_definition', 163, 'en', ''),
(2038, 'behavior_definition', 164, 'tw', '當組織內危機狀況發生時，馬上就可以了解情況並掌握危機發生的原因。'),
(2039, 'behavior_definition', 164, 'cn', ''),
(2040, 'behavior_definition', 164, 'en', ''),
(2041, 'behavior_definition', 165, 'tw', '可以辨別出問題發生的各種原因對組織影響程度的大小。'),
(2042, 'behavior_definition', 165, 'cn', ''),
(2043, 'behavior_definition', 165, 'en', ''),
(2044, 'behavior_definition', 166, 'tw', '能夠針對危機發生的原因，提出初步的應變措施以阻止事件的擴大。'),
(2045, 'behavior_definition', 166, 'cn', ''),
(2046, 'behavior_definition', 166, 'en', ''),
(2047, 'behavior_definition', 167, 'tw', '能針對危機提出數種不同的應對與解決方案，並進行可行性評估分析後，決定採取何種方案對組織最有利。'),
(2048, 'behavior_definition', 167, 'cn', ''),
(2049, 'behavior_definition', 167, 'en', ''),
(2050, 'behavior_definition', 168, 'tw', '執行適當的行動方案，使組織受到的傷害減到最低或化解危機。'),
(2051, 'behavior_definition', 168, 'cn', ''),
(2052, 'behavior_definition', 168, 'en', ''),
(2053, 'behavior_definition', 169, 'tw', '樂意了解員工的需求以及需要協助的地方，能提供員工諮詢的機會。'),
(2054, 'behavior_definition', 169, 'cn', ''),
(2055, 'behavior_definition', 169, 'en', ''),
(2056, 'behavior_definition', 170, 'tw', '總是可以透過有效的問答技巧與聆聽來了解員工的真正需求。'),
(2057, 'behavior_definition', 170, 'cn', ''),
(2058, 'behavior_definition', 170, 'en', ''),
(2059, 'behavior_definition', 171, 'tw', '員工提出需求後會詳加考慮並提出可行的回應，讓員工有需求被滿足的機會，並且提供員工自行實現的機會。'),
(2060, 'behavior_definition', 171, 'cn', ''),
(2061, 'behavior_definition', 171, 'en', ''),
(2062, 'behavior_definition', 172, 'tw', '放心的將部分的權力下放給員工，容許犯錯，協助成長，讓其可以充分發揮。'),
(2063, 'behavior_definition', 172, 'cn', ''),
(2064, 'behavior_definition', 172, 'en', ''),
(2065, 'behavior_definition', 173, 'tw', '能夠透過給予員工自我管理的權力，讓他們朝組織目標發展。'),
(2066, 'behavior_definition', 173, 'cn', ''),
(2067, 'behavior_definition', 173, 'en', ''),
(2068, 'behavior_definition', 174, 'tw', '公司的願景能長期的激勵人心、維持員工及利害關係人的認同感。'),
(2069, 'behavior_definition', 174, 'cn', ''),
(2070, 'behavior_definition', 174, 'en', ''),
(2071, 'behavior_definition', 175, 'tw', '在公司開會或與員工互動時，會適時向員工宣傳公司的願景。'),
(2072, 'behavior_definition', 175, 'cn', ''),
(2073, 'behavior_definition', 175, 'en', ''),
(2074, 'behavior_definition', 176, 'tw', '能以身作則，讓自己的行為舉止符合公司願景的形象。'),
(2075, 'behavior_definition', 176, 'cn', ''),
(2076, 'behavior_definition', 176, 'en', ''),
(2077, 'behavior_definition', 177, 'tw', '能將公司的願景推廣到公司外部，使供應商、顧客及公司的利益關係人也都能知道公司願景。'),
(2078, 'behavior_definition', 177, 'cn', ''),
(2079, 'behavior_definition', 177, 'en', ''),
(2080, 'behavior_definition', 178, 'tw', '能促使社會大眾對於公司願景耳熟能詳，並且認同實際情形與公司的形象相符合。'),
(2081, 'behavior_definition', 178, 'cn', ''),
(2082, 'behavior_definition', 178, 'en', ''),
(2083, 'competency_definition', 118, 'tw', '能針對部屬工作能力的不足之處，提供在職教育訓練的機會；能發揮部屬的潛力，持續追蹤並適時給予指導。'),
(2084, 'competency_definition', 118, 'cn', ''),
(2085, 'competency_definition', 118, 'en', ''),
(2086, 'competency_definition', 119, 'tw', '能夠辨識目標的優先等級，建立縝密的行動計劃，有效規劃所需的人力與資源；協助組織成員建立有系統的方法與步驟完成目標。'),
(2087, 'competency_definition', 119, 'cn', ''),
(2088, 'competency_definition', 119, 'en', ''),
(2089, 'competency_definition', 120, 'tw', '能夠運用組織各種相關資源，透過一定的作業流程，將策略或計畫有效落實以達到公司既定的目標。'),
(2090, 'competency_definition', 120, 'cn', ''),
(2091, 'competency_definition', 120, 'en', ''),
(2092, 'competency_definition', 121, 'tw', '對於預定的工作計畫或上司交辦的事項，能夠意識到時間的急迫性，在既定的時間內完成，以達成預定的工作目標。'),
(2093, 'competency_definition', 121, 'cn', ''),
(2094, 'competency_definition', 121, 'en', ''),
(2095, 'competency_definition', 122, 'tw', '能夠與其他成員有系統的運用語言、文字、動作或圖像等，彼此交換和分享訊息、觀念、想法和態度。'),
(2096, 'competency_definition', 122, 'cn', ''),
(2097, 'competency_definition', 122, 'en', '');
INSERT INTO `text` (`term_id`, `term_title`, `depend_on_id`, `term_language`, `text_content`) VALUES
(2098, 'competency_definition', 123, 'tw', '能塑造明確的團隊文化及瞭解個別成員的能力及特性，運用適當且具有彈性的互動模式，激勵及指引團隊成功的完成任務。'),
(2099, 'competency_definition', 123, 'cn', ''),
(2100, 'competency_definition', 123, 'en', ''),
(2101, 'behavior_definition', 179, 'tw', '能夠有計劃、持續的透過不同情境案例的訓練或實作等方式來增強部屬的能力。'),
(2102, 'behavior_definition', 179, 'cn', ''),
(2103, 'behavior_definition', 179, 'en', ''),
(2104, 'behavior_definition', 180, 'tw', '在可控範圍內能容忍部屬犯錯，並給予及時的指導。'),
(2105, 'behavior_definition', 180, 'cn', ''),
(2106, 'behavior_definition', 180, 'en', ''),
(2107, 'behavior_definition', 181, 'tw', '清楚知道部屬欠缺的能力，並會依此安排持續特定的指導和教育訓練。'),
(2108, 'behavior_definition', 181, 'cn', ''),
(2109, 'behavior_definition', 181, 'en', ''),
(2110, 'behavior_definition', 182, 'tw', '當部屬有疑惑時，除了告訴他們如何解決並樂意將經驗分享給部屬外，也會告訴他們實際的成因為何。'),
(2111, 'behavior_definition', 182, 'cn', ''),
(2112, 'behavior_definition', 182, 'en', ''),
(2113, 'behavior_definition', 183, 'tw', '能依據目前單位的發展需求提供機會給部屬進行工作歷練的指導。'),
(2114, 'behavior_definition', 183, 'cn', ''),
(2115, 'behavior_definition', 183, 'en', ''),
(2116, 'behavior_definition', 184, 'tw', '能夠針對各項必須執行的計劃，事先進行初步規劃。'),
(2117, 'behavior_definition', 184, 'cn', ''),
(2118, 'behavior_definition', 184, 'en', ''),
(2119, 'behavior_definition', 185, 'tw', '針對各項計劃所需的時間和資源，進行分析與選擇制定工作進度。'),
(2120, 'behavior_definition', 185, 'cn', ''),
(2121, 'behavior_definition', 185, 'en', ''),
(2122, 'behavior_definition', 186, 'tw', '執行各項複雜計劃前，能夠主動預測計劃的輕重緩急及未來可能的變化。'),
(2123, 'behavior_definition', 186, 'cn', ''),
(2124, 'behavior_definition', 186, 'en', ''),
(2125, 'behavior_definition', 187, 'tw', '能夠訂定各項複雜計劃應對的解決策略及行動方案，以便狀況發生時能產生機動性的應變，維持各計劃的正常進度。'),
(2126, 'behavior_definition', 187, 'cn', ''),
(2127, 'behavior_definition', 187, 'en', ''),
(2128, 'behavior_definition', 188, 'tw', '能夠在考量組織未來目標、內外環境狀況與組織內部資源下，事先做好各種計劃的詳細規劃。'),
(2129, 'behavior_definition', 188, 'cn', ''),
(2130, 'behavior_definition', 188, 'en', ''),
(2131, 'behavior_definition', 189, 'tw', '會依據標準作業流程來執行工作，並在工作進度、任務品質與成本控制間取得良好平衡點。'),
(2132, 'behavior_definition', 189, 'cn', ''),
(2133, 'behavior_definition', 189, 'en', ''),
(2134, 'behavior_definition', 190, 'tw', '會檢討工作執行的效率與效益，找出改善方案持續改進，提昇工作品質及效率。'),
(2135, 'behavior_definition', 190, 'cn', ''),
(2136, 'behavior_definition', 190, 'en', ''),
(2137, 'behavior_definition', 191, 'tw', '注重工作時效，能有效管理時間和資源，確保工作能有效率的完成。'),
(2138, 'behavior_definition', 191, 'cn', ''),
(2139, 'behavior_definition', 191, 'en', ''),
(2140, 'behavior_definition', 192, 'tw', '在任務執行過程中，會依據工作計劃表來監督、控管與查核任務的完成進度，以及工作方向與內容的正確性。'),
(2141, 'behavior_definition', 192, 'cn', ''),
(2142, 'behavior_definition', 192, 'en', ''),
(2143, 'behavior_definition', 193, 'tw', '當進度落後或遇到困難時，會立即反應尋求相關資源與協助，確保在預定時間內完成工作任務。'),
(2144, 'behavior_definition', 193, 'cn', ''),
(2145, 'behavior_definition', 193, 'en', ''),
(2146, 'behavior_definition', 194, 'tw', '在進行工作前會預先思考，再安排各作業的先後執行順序，並能夠在標準時間內完成工作。'),
(2147, 'behavior_definition', 194, 'cn', ''),
(2148, 'behavior_definition', 194, 'en', ''),
(2149, 'behavior_definition', 195, 'tw', '能運用各種提升或改善工作執行成效的工具和設備，以減少因工具/設備缺失所造成的時間浪費。'),
(2150, 'behavior_definition', 195, 'cn', ''),
(2151, 'behavior_definition', 195, 'en', ''),
(2152, 'behavior_definition', 196, 'tw', '能持續精進現有的作業流程或操作程序，以提高作業效率。'),
(2153, 'behavior_definition', 196, 'cn', ''),
(2154, 'behavior_definition', 196, 'en', ''),
(2155, 'behavior_definition', 197, 'tw', '能在內、外部客戶要求的標準及作業期限前，如質、如量的完成工作任務。'),
(2156, 'behavior_definition', 197, 'cn', ''),
(2157, 'behavior_definition', 197, 'en', ''),
(2158, 'behavior_definition', 198, 'tw', '具成本意識，並會留意和減少作業過程中不當的浪費與損耗。'),
(2159, 'behavior_definition', 198, 'cn', ''),
(2160, 'behavior_definition', 198, 'en', ''),
(2161, 'behavior_definition', 199, 'tw', '對於自己傳達資訊所選用的方式能讓對方清楚的接收到訊息。'),
(2162, 'behavior_definition', 199, 'cn', ''),
(2163, 'behavior_definition', 199, 'en', ''),
(2164, 'behavior_definition', 200, 'tw', '不先入為主，願意花時間傾聽他人的看法、意見，並能以自身經驗與他人分享以取得共識，經由良性互動以排除問題或障礙。'),
(2165, 'behavior_definition', 200, 'cn', ''),
(2166, 'behavior_definition', 200, 'en', ''),
(2167, 'behavior_definition', 201, 'tw', '處事圓融，能耐心處理，聆聽內、外部顧客抱怨，能控制情緒不使衝突發生。'),
(2168, 'behavior_definition', 201, 'cn', ''),
(2169, 'behavior_definition', 201, 'en', ''),
(2170, 'behavior_definition', 202, 'tw', '能視不同狀況調整溝通技巧，順利與組織內外部成員溝通。'),
(2171, 'behavior_definition', 202, 'cn', ''),
(2172, 'behavior_definition', 202, 'en', ''),
(2173, 'behavior_definition', 203, 'tw', '能誠懇的回應或信實轉達他人的訊息。'),
(2174, 'behavior_definition', 203, 'cn', ''),
(2175, 'behavior_definition', 203, 'en', ''),
(2176, 'behavior_definition', 204, 'tw', '瞭解各類型成員的行事風格及專長差異，能將團隊成員依屬性、專長加以分類並按此分配任務。'),
(2177, 'behavior_definition', 204, 'cn', ''),
(2178, 'behavior_definition', 204, 'en', ''),
(2179, 'behavior_definition', 205, 'tw', '能設計團隊成員的交流活動，增進團隊成員間的瞭解和互動，以建立團隊意識。'),
(2180, 'behavior_definition', 205, 'cn', ''),
(2181, 'behavior_definition', 205, 'en', ''),
(2182, 'behavior_definition', 206, 'tw', '能讓團隊成員清楚瞭解團隊目標，並以實際行動來展現和強化團隊達成目標的承諾。'),
(2183, 'behavior_definition', 206, 'cn', ''),
(2184, 'behavior_definition', 206, 'en', ''),
(2185, 'behavior_definition', 207, 'tw', '能建立一套制度和獎勵措施來營造團隊合作精神，讓團隊成員願意遵守。'),
(2186, 'behavior_definition', 207, 'cn', ''),
(2187, 'behavior_definition', 207, 'en', ''),
(2188, 'behavior_definition', 208, 'tw', '強化團隊的凝聚力，經由充分授權建立團隊的自治精神，即使處境艱困團隊成員皆能相應的協助與支持，追隨領導者完成任務。'),
(2189, 'behavior_definition', 208, 'cn', ''),
(2190, 'behavior_definition', 208, 'en', ''),
(2191, 'competency_definition', 124, 'tw', '能清楚個人目標，並自行訂定工作計劃，有效率的管控時間以確保工作完成。'),
(2192, 'competency_definition', 124, 'cn', ''),
(2193, 'competency_definition', 124, 'en', ''),
(2194, 'competency_definition', 125, 'tw', '能透過標準作業流程，將計畫有效落實，出現異常時能做出調整排除障礙，以達成團隊既定的目標。'),
(2195, 'competency_definition', 125, 'cn', ''),
(2196, 'competency_definition', 125, 'en', ''),
(2197, 'competency_definition', 126, 'tw', '能與他人通力合作，成為團隊的一份子，彼此互相溝通協助，以解決問題或完成計畫，一起工作而非分開工作或互相競爭。'),
(2198, 'competency_definition', 126, 'cn', ''),
(2199, 'competency_definition', 126, 'en', ''),
(2200, 'competency_definition', 127, 'tw', '確實遵循工作標準程序，注重工作細節，能運用回饋機制找出品質問題並進行改善，不斷提升工作品質。'),
(2201, 'competency_definition', 127, 'cn', ''),
(2202, 'competency_definition', 127, 'en', ''),
(2203, 'competency_definition', 128, 'tw', '能夠建立並維持顧客關係，理解內、外部顧客的感受與需求，採取行動滿足顧客，以提升內、外部顧客對產品或服務的信任與依賴。'),
(2204, 'competency_definition', 128, 'cn', ''),
(2205, 'competency_definition', 128, 'en', ''),
(2206, 'competency_definition', 129, 'tw', '能確認、了解問題或議題所在，進行可行性分析，採取最適當的執行方案，解決問題。'),
(2207, 'competency_definition', 129, 'cn', ''),
(2208, 'competency_definition', 129, 'en', ''),
(2209, 'behavior_definition', 209, 'tw', '能分辨清楚事情及任務的輕重緩急，適時的調整工作的優先次序。'),
(2210, 'behavior_definition', 209, 'cn', ''),
(2211, 'behavior_definition', 209, 'en', ''),
(2212, 'behavior_definition', 210, 'tw', '能確保作業所需的器材、物品或文件檔案準備妥當，使得自己或他人的工作能有效的完成。'),
(2213, 'behavior_definition', 210, 'cn', ''),
(2214, 'behavior_definition', 210, 'en', ''),
(2215, 'behavior_definition', 211, 'tw', '能有效分配自己的時間，協調本身與他人的時間表以避免作業時間的衝突。'),
(2216, 'behavior_definition', 211, 'cn', ''),
(2217, 'behavior_definition', 211, 'en', ''),
(2218, 'behavior_definition', 212, 'tw', '能善用既有資源(包括可運用的人力、工具及相關單位的協作等)，協同部屬共同設定目標，定時追蹤目標執行進度，以確保工作能在預定的時間內完成。'),
(2219, 'behavior_definition', 212, 'cn', ''),
(2220, 'behavior_definition', 212, 'en', ''),
(2221, 'behavior_definition', 213, 'tw', '能注重工作時效，有效管理工作流程與進度。'),
(2222, 'behavior_definition', 213, 'cn', ''),
(2223, 'behavior_definition', 213, 'en', ''),
(2224, 'behavior_definition', 214, 'tw', '能訂定工作進度表，以規劃各階段任務的執行時間。'),
(2225, 'behavior_definition', 214, 'cn', ''),
(2226, 'behavior_definition', 214, 'en', ''),
(2227, 'behavior_definition', 215, 'tw', '會堅持依據公司既定的SOP規範來執行工作以確保工作品質。'),
(2228, 'behavior_definition', 215, 'cn', ''),
(2229, 'behavior_definition', 215, 'en', ''),
(2230, 'behavior_definition', 216, 'tw', '能夠適度的使用組織資源，完成工作任務以達到公司既定的目標。'),
(2231, 'behavior_definition', 216, 'cn', ''),
(2232, 'behavior_definition', 216, 'en', ''),
(2233, 'behavior_definition', 217, 'tw', '能夠自我監控工作的進度與診斷執行績效。'),
(2234, 'behavior_definition', 217, 'cn', ''),
(2235, 'behavior_definition', 217, 'en', ''),
(2236, 'behavior_definition', 218, 'tw', '能檢討工作執行的效率與效益，並找出改善方案以持續改進。'),
(2237, 'behavior_definition', 218, 'cn', ''),
(2238, 'behavior_definition', 218, 'en', ''),
(2239, 'behavior_definition', 219, 'tw', '能積極鼓勵其他團隊成員參與團隊決議形成的過程，並能讓他們充份表達自己的意見與想法。'),
(2240, 'behavior_definition', 219, 'cn', ''),
(2241, 'behavior_definition', 219, 'en', ''),
(2242, 'behavior_definition', 220, 'tw', '樂於接納團隊角色的分配，並能善盡在團隊中所扮演的角色。'),
(2243, 'behavior_definition', 220, 'cn', ''),
(2244, 'behavior_definition', 220, 'en', ''),
(2245, 'behavior_definition', 221, 'tw', '能配合團隊的決議、不固執個人立場，配合團隊的決議行動。'),
(2246, 'behavior_definition', 221, 'cn', ''),
(2247, 'behavior_definition', 221, 'en', ''),
(2248, 'behavior_definition', 222, 'tw', '能從團體成就的角度來檢視自己的表現，不邀功，不諉過。'),
(2249, 'behavior_definition', 222, 'cn', ''),
(2250, 'behavior_definition', 222, 'en', ''),
(2251, 'behavior_definition', 223, 'tw', '能夠主動激勵團隊成員，鼓舞士氣排除困難共同完成任務。'),
(2252, 'behavior_definition', 223, 'cn', ''),
(2253, 'behavior_definition', 223, 'en', ''),
(2254, 'behavior_definition', 224, 'tw', '能夠在工作完成前再次進行檢查，確定所完成的成果符合品質要求。'),
(2255, 'behavior_definition', 224, 'cn', ''),
(2256, 'behavior_definition', 224, 'en', ''),
(2257, 'behavior_definition', 225, 'tw', '作業過程中會自我進行作業成果的抽查檢驗。'),
(2258, 'behavior_definition', 225, 'cn', ''),
(2259, 'behavior_definition', 225, 'en', ''),
(2260, 'behavior_definition', 226, 'tw', '個人的工作成果正確度高，能讓人充分的信賴。'),
(2261, 'behavior_definition', 226, 'cn', ''),
(2262, 'behavior_definition', 226, 'en', ''),
(2263, 'behavior_definition', 227, 'tw', '熟悉工作職能及特性，能夠對品質的優劣進行自我檢視，並建立應有的品質水準。'),
(2264, 'behavior_definition', 227, 'cn', ''),
(2265, 'behavior_definition', 227, 'en', ''),
(2266, 'behavior_definition', 228, 'tw', '能夠設立品質標準以檢視生產結果是否符合要求。'),
(2267, 'behavior_definition', 228, 'cn', ''),
(2268, 'behavior_definition', 228, 'en', ''),
(2269, 'behavior_definition', 229, 'tw', '瞭解滿足顧客需求不僅是工作要求，更是一種發自內心的真誠，因此會願意額外付出來滿足客戶。'),
(2270, 'behavior_definition', 229, 'cn', ''),
(2271, 'behavior_definition', 229, 'en', ''),
(2272, 'behavior_definition', 230, 'tw', '考量所採取的行動或計劃，會對內、外部客戶產生什麼影響。'),
(2273, 'behavior_definition', 230, 'cn', ''),
(2274, 'behavior_definition', 230, 'en', ''),
(2275, 'behavior_definition', 231, 'tw', '用積極正向、就事論事的態度來排除內、外部客戶的衝突，並共同尋求解決方案。'),
(2276, 'behavior_definition', 231, 'cn', ''),
(2277, 'behavior_definition', 231, 'en', ''),
(2278, 'behavior_definition', 232, 'tw', '具備成本意識，能以自身專業知識及有效方法，滿足內、外部客戶的期望與需要。'),
(2279, 'behavior_definition', 232, 'cn', ''),
(2280, 'behavior_definition', 232, 'en', ''),
(2281, 'behavior_definition', 233, 'tw', '能正確評估顧客的不滿意問題，進行檢討與改善。'),
(2282, 'behavior_definition', 233, 'cn', ''),
(2283, 'behavior_definition', 233, 'en', ''),
(2284, 'behavior_definition', 234, 'tw', '當問題發生時能夠廣泛收集資訊，能將問題具體化找出問題的根源。'),
(2285, 'behavior_definition', 234, 'cn', ''),
(2286, 'behavior_definition', 234, 'en', ''),
(2287, 'behavior_definition', 235, 'tw', '能針對日常工作中所面臨的障礙與問題，提出行動改善計畫及解決方案。'),
(2288, 'behavior_definition', 235, 'cn', ''),
(2289, 'behavior_definition', 235, 'en', ''),
(2290, 'behavior_definition', 236, 'tw', '能依可行的解決方案，整合相關人員共同執行以達成最終期望的結果。'),
(2291, 'behavior_definition', 236, 'cn', ''),
(2292, 'behavior_definition', 236, 'en', ''),
(2293, 'behavior_definition', 237, 'tw', '對於複雜的問題，能在現有條件限制下，提出幾種可行的解決方案，供上級決策。'),
(2294, 'behavior_definition', 237, 'cn', ''),
(2295, 'behavior_definition', 237, 'en', ''),
(2296, 'behavior_definition', 238, 'tw', '能將解決問題的知識與技巧妥善紀錄、保存與管理，做為以後處理類似問題的借鑑。'),
(2297, 'behavior_definition', 238, 'cn', ''),
(2298, 'behavior_definition', 238, 'en', ''),
