(2571, 'behavior_definition', 240, 'en', ''),
(2572, 'behavior_definition', 241, 'tw', '能運用現有資源建立並維持良好人際網絡關係。'),
(2573, 'behavior_definition', 241, 'cn', ''),
(2574, 'behavior_definition', 241, 'en', ''),
(2575, 'behavior_definition', 242, 'tw', '遇到困難時能善用人際網絡有效解決問題。'),
(2576, 'behavior_definition', 242, 'cn', ''),
(2577, 'behavior_definition', 242, 'en', ''),
(2578, 'behavior_definition', 243, 'tw', '願意擔任社團、公學會領導人、理監事等，以培養領導才能及尋求有利於工作推動的人際網絡關係。'),
(2579, 'behavior_definition', 243, 'cn', ''),
(2580, 'behavior_definition', 243, 'en', ''),
(2581, 'competency_definition', 131, 'tw', '指將顧客的需要視為第一要務；與顧客建立及維持良性的互動關係。'),
(2582, 'competency_definition', 131, 'cn', ''),
(2583, 'competency_definition', 131, 'en', ''),
(2584, 'behavior_definition', 244, 'tw', '能了解顧客的需求及期望，主動提供服務以滿足顧客的需求。'),
(2585, 'behavior_definition', 244, 'cn', ''),
(2586, 'behavior_definition', 244, 'en', ''),
(2587, 'behavior_definition', 245, 'tw', '運用人際溝通技巧，以尊重、同理心與顧客建立良好的互動與關係。'),
(2588, 'behavior_definition', 245, 'cn', ''),
(2589, 'behavior_definition', 245, 'en', ''),
(2590, 'behavior_definition', 246, 'tw', '能有效評估顧客的不滿意問題，進行檢討與改善。'),
(2591, 'behavior_definition', 246, 'cn', ''),
(2592, 'behavior_definition', 246, 'en', ''),
(2593, 'behavior_definition', 247, 'tw', '會運用有效的方法來了解評估病患及其家屬的考量或問題，並能設法滿足病患或家屬的潛在需求。'),
(2594, 'behavior_definition', 247, 'cn', ''),
(2595, 'behavior_definition', 247, 'en', ''),
(2596, 'behavior_definition', 248, 'tw', '能提供滿意的醫療服務，視病猶親，提昇病患或家屬對本院的信任與依賴度。'),
(2597, 'behavior_definition', 248, 'cn', ''),
(2598, 'behavior_definition', 248, 'en', ''),
(2599, 'competency_definition', 132, 'tw', '能清楚說明團隊目標，提供團隊所需資源與資訊，進行有效分工，促進團隊合作。'),
(2600, 'competency_definition', 132, 'cn', ''),
(2601, 'competency_definition', 132, 'en', ''),
(2602, 'behavior_definition', 249, 'tw', '規劃或執行團隊工作時能從醫院或部門單位的整體利益考量著想。'),
(2603, 'behavior_definition', 249, 'cn', ''),
(2604, 'behavior_definition', 249, 'en', ''),
(2605, 'behavior_definition', 250, 'tw', '能尊重團隊成員意見，支持團隊決定，共同合作達成團隊目標。'),
(2606, 'behavior_definition', 250, 'cn', ''),
(2607, 'behavior_definition', 250, 'en', ''),
(2608, 'behavior_definition', 251, 'tw', '在團隊合作過程中，會主動積極地排除困難，並且提供有益於最後問題解決的方案。'),
(2609, 'behavior_definition', 251, 'cn', ''),
(2610, 'behavior_definition', 251, 'en', ''),
(2611, 'behavior_definition', 252, 'tw', '能視工作需要與其他部門建立良好團隊關係，協同合作以達成團隊合作的目標。'),
(2612, 'behavior_definition', 252, 'cn', ''),
(2613, 'behavior_definition', 252, 'en', ''),
(2614, 'behavior_definition', 253, 'tw', '能主動提出有助於跨團隊合作衝突的排除或是團隊士氣的激勵方法以達成組織目標。'),
(2615, 'behavior_definition', 253, 'cn', ''),
(2616, 'behavior_definition', 253, 'en', ''),
(2617, 'competency_definition', 133, 'tw', '根據醫院願景、現況資源，設定目標制定醫院發展的決策，規劃系列的行動方案；並能依部屬的能力授予適當權力，清楚說明授權範圍，尊重部屬所做的決策，並適時提供諮詢，以達成醫院的願景與目標。'),
(2618, 'competency_definition', 133, 'cn', ''),
(2619, 'competency_definition', 133, 'en', ''),
(2620, 'behavior_definition', 254, 'tw', '能根據現況、資源及醫院價值觀，制定目標、決策並規劃系列的行動方案。'),
(2621, 'behavior_definition', 254, 'cn', ''),
(2622, 'behavior_definition', 254, 'en', ''),
(2623, 'behavior_definition', 255, 'tw', '能蒐集決策所需資訊提出各種可能方案，並依據決策標準，考量相關主管、部屬意見，適時選擇有效方案加以執行。'),
(2624, 'behavior_definition', 255, 'cn', ''),
(2625, 'behavior_definition', 255, 'en', ''),
(2626, 'behavior_definition', 256, 'tw', '能依醫院決策所提出方案，並要求所屬單位依據決策標準，有效執行以達成醫院的願景與目標。'),
(2627, 'behavior_definition', 256, 'cn', ''),
(2628, 'behavior_definition', 256, 'en', ''),
(2629, 'behavior_definition', 257, 'tw', '能依部屬的職權範圍授與自我管理的權力，讓他們朝組織目標發展。'),
(2630, 'behavior_definition', 257, 'cn', ''),
(2631, 'behavior_definition', 257, 'en', ''),
(2632, 'behavior_definition', 258, 'tw', '在部屬的授權範圍內能尊重他人所做的決定，並適時提供諮詢，協助其成長以達成目標。'),
(2633, 'behavior_definition', 258, 'cn', ''),
(2634, 'behavior_definition', 258, 'en', ''),
(2635, 'competency_definition', 134, 'tw', '有效的運用人力、物力資源，確保在計劃時間內有效率的完成工作。'),
(2636, 'competency_definition', 134, 'cn', ''),
(2637, 'competency_definition', 134, 'en', ''),
(2638, 'behavior_definition', 259, 'tw', '能妥善利用人力、物力資源，積極辦理與落實醫院各項決策的進行。'),
(2639, 'behavior_definition', 259, 'cn', ''),
(2640, 'behavior_definition', 259, 'en', ''),
(2641, 'behavior_definition', 260, 'tw', '能確實向所屬單位宣導本院政策，推動政策的執行及成效的管控。'),
(2642, 'behavior_definition', 260, 'cn', ''),
(2643, 'behavior_definition', 260, 'en', ''),
(2644, 'behavior_definition', 261, 'tw', '能按時間表追縱工作進度，在預定時間內完成工作任務。'),
(2645, 'behavior_definition', 261, 'cn', ''),
(2646, 'behavior_definition', 261, 'en', ''),
(2647, 'behavior_definition', 262, 'tw', '注重工作時效，能妥善運用自己的時間與資源，有效管理工作的流程與進度。'),
(2648, 'behavior_definition', 262, 'cn', ''),
(2649, 'behavior_definition', 262, 'en', ''),
(2650, 'behavior_definition', 263, 'tw', '會依任務不同主動回報階段性或最終的執行成果。'),
(2651, 'behavior_definition', 263, 'cn', ''),
(2652, 'behavior_definition', 263, 'en', ''),
(2653, 'competency_definition', 135, 'tw', '指能確認、了解議題或問題的本質，並能比較不同來源的資料，做出可行的方案以供選擇。'),
(2654, 'competency_definition', 135, 'cn', ''),
(2655, 'competency_definition', 135, 'en', ''),
(2656, 'behavior_definition', 264, 'tw', '能找出工作中面臨的議題或問題，發展並採取必要的行動。'),
(2657, 'behavior_definition', 264, 'cn', ''),
(2658, 'behavior_definition', 264, 'en', ''),
(2659, 'behavior_definition', 265, 'tw', '會蒐集並查證資料的正確性，以更了解所面臨的議題或問題(例如：詢問他人、查閱檔案、報表文件等)。'),
(2660, 'behavior_definition', 265, 'cn', ''),
(2661, 'behavior_definition', 265, 'en', ''),
(2662, 'behavior_definition', 266, 'tw', '會整合不同來源的資料，並從中發現所有資料的相關趨勢、關聯性及因果關係。'),
(2663, 'behavior_definition', 266, 'cn', ''),
(2664, 'behavior_definition', 266, 'en', ''),
(2665, 'behavior_definition', 267, 'tw', '針對自身權限範圍內的問題，發展出多項可行方案/解決方法，以達成最終期望的結果。'),
(2666, 'behavior_definition', 267, 'cn', ''),
(2667, 'behavior_definition', 267, 'en', ''),
(2668, 'behavior_definition', 268, 'tw', '不但能有效的解決問題，還能將解決問題的知識與技巧傳承，做為以後遇到相同狀況時的處理模式。'),
(2669, 'behavior_definition', 268, 'cn', ''),
(2670, 'behavior_definition', 268, 'en', ''),
(2671, 'competency_definition', 136, 'tw', '在行動或制定計劃時能考量對顧客的影響，主動瞭解內外部顧客的需求，迅速回應並提供所需服務。'),
(2672, 'competency_definition', 136, 'cn', ''),
(2673, 'competency_definition', 136, 'en', ''),
(2674, 'behavior_definition', 269, 'tw', '能快速回應內外部顧客的問題，即時提供顧客所需的服務。'),
(2675, 'behavior_definition', 269, 'cn', ''),
(2676, 'behavior_definition', 269, 'en', ''),
(2677, 'behavior_definition', 270, 'tw', '對顧客展現服務熱忱，能以自身專業知識有效滿足內外部顧客的需求或解決問題，進而提高顧客滿意度。'),
(2678, 'behavior_definition', 270, 'cn', ''),
(2679, 'behavior_definition', 270, 'en', ''),
(2680, 'behavior_definition', 271, 'tw', '在制訂計劃或日常行為中，能時時為內外部顧客的需求著想，以替醫院維持良好的顧客關係。'),
(2681, 'behavior_definition', 271, 'cn', ''),
(2682, 'behavior_definition', 271, 'en', ''),
(2683, 'behavior_definition', 272, 'tw', '能冷靜與鎮定的處理內外部顧客的衝突，並共同尋求解決方案。'),
(2684, 'behavior_definition', 272, 'cn', ''),
(2685, 'behavior_definition', 272, 'en', ''),
(2686, 'behavior_definition', 273, 'tw', '提供內外部顧客所需資訊，協助醫院與顧客建立良好的互動關係。'),
