(2705, 'b_evalu_table_desc', 12, 'cn', ''),
(2706, 'b_evalu_table_desc', 12, 'en', ''),
(2707, 'competency_definition', 137, 'tw', '能以友善的態度、親切的接待「內外部顧客」；秉持「視病猶親」、「醫者父母心」的服務理念，照顧病患，尊重病患權益，以解決病患及家屬的問題。'),
(2708, 'competency_definition', 137, 'cn', ''),
(2709, 'competency_definition', 137, 'en', ''),
(2710, 'competency_definition', 138, 'tw', '能設身處地為「內外部顧客」著想，提供顧客滿意的服務水準，竭盡所能為病患服務，讓病患能感受到溫暖與親切的服務。'),
(2711, 'competency_definition', 138, 'cn', ''),
(2712, 'competency_definition', 138, 'en', ''),
(2713, 'competency_definition', 139, 'tw', '以顧客滿意為標的，持續改進服務內容及服務程序，以追求服務品質的提升。'),
(2714, 'competency_definition', 139, 'cn', ''),
(2715, 'competency_definition', 139, 'en', ''),
(2716, 'competency_definition', 140, 'tw', '持續關心醫院或個人的工作成果和表現是否令人滿意，並能設定具挑戰性的組織、個人目標或較高的工作成果要求，在組織整體表現或個人能力上，追求超越目標或成果的提升。'),
(2717, 'competency_definition', 140, 'cn', ''),
(2718, 'competency_definition', 140, 'en', ''),
(2719, 'behavior_definition', 274, 'tw', '談話時，對病患或家屬能有禮貌的尊稱，或隨家屬對病患的稱呼進行溝通交談。'),
(2720, 'behavior_definition', 274, 'cn', ''),
(2721, 'behavior_definition', 274, 'en', ''),
(2722, 'behavior_definition', 275, 'tw', '能秉持「視病猶親」，不分國籍、種族、性別、年齡、職業、貧富等之差別，不拒絕病患，對於需要服務之民眾皆公平對待、提供服務。'),
(2723, 'behavior_definition', 275, 'cn', ''),
(2724, 'behavior_definition', 275, 'en', ''),
(2725, 'behavior_definition', 276, 'tw', '對「內外部顧客」態度誠懇、語氣親切，要能傾聽「內外部顧客」的表達，並用同理心去看待事件。'),
(2726, 'behavior_definition', 276, 'cn', ''),
(2727, 'behavior_definition', 276, 'en', ''),
(2728, 'behavior_definition', 277, 'tw', '對「內外部顧客」能不固執己見，具有包容心，了解「自我虛實」，開放胸襟，以接納他人的意見。'),
(2729, 'behavior_definition', 277, 'cn', ''),
(2730, 'behavior_definition', 277, 'en', ''),
(2731, 'behavior_definition', 278, 'tw', '籌辦社區睦鄰活動、人文關懷，增進鄰里關係，進而將健康的觀念導入社區，協助社區居民共同創造健康美好的生活。'),
(2732, 'behavior_definition', 278, 'cn', ''),
(2733, 'behavior_definition', 278, 'en', ''),
(2734, 'behavior_definition', 279, 'tw', '能運用微笑、親切的接待，以降低病患的不安全感，讓病患感覺醫院就像是家裡的保健中心，消除病患及家屬對醫院的疏離感。'),
(2735, 'behavior_definition', 279, 'cn', ''),
(2736, 'behavior_definition', 279, 'en', ''),
(2737, 'behavior_definition', 280, 'tw', '能夠預先告知病患及家屬可能發生的各種潛在問題或需求；並以同理心及主動服務的熱忱，站在病患及家屬的角度看待事情。'),
(2738, 'behavior_definition', 280, 'cn', ''),
(2739, 'behavior_definition', 280, 'en', ''),
(2740, 'behavior_definition', 281, 'tw', '能以病人情況優先考量，提供身、心、靈全方位的醫療照護服務，並竭盡所能為病人服務。'),
(2741, 'behavior_definition', 281, 'cn', ''),
(2742, 'behavior_definition', 281, 'en', ''),
(2743, 'behavior_definition', 282, 'tw', '在滿足「內外部顧客」的服務過程中，能先了解顧客的需求，不斷提高服務的附加價值，以超越顧客預期的服務結果。'),
(2744, 'behavior_definition', 282, 'cn', ''),
(2745, 'behavior_definition', 282, 'en', ''),
(2746, 'behavior_definition', 283, 'tw', '評量分析與管理醫院組織的內/外部顧客滿意度，並運用各種方法或途徑，以達成優良的「口碑服務」結果。'),
(2747, 'behavior_definition', 283, 'cn', ''),
(2748, 'behavior_definition', 283, 'en', ''),
(2749, 'behavior_definition', 284, 'tw', '能建構以病人安全為中心的各項措施及作業流程，落實品質監測機制，加強防範醫療異常的發生，確實做到維護病人安全與就醫權益。'),
(2750, 'behavior_definition', 284, 'cn', ''),
(2751, 'behavior_definition', 284, 'en', ''),
(2752, 'behavior_definition', 285, 'tw', '「細節決定成敗」，能依標準作業流程、務實的態度做好每件小事；「一歩一腳印」，執行服務流程。'),
(2753, 'behavior_definition', 285, 'cn', ''),
(2754, 'behavior_definition', 285, 'en', ''),
(2755, 'behavior_definition', 286, 'tw', '會定期審視服務內容及服務程序，並鼓勵通報異常事件及跡近錯失事件，尋求改善的機會，以提升服務品質。'),
(2756, 'behavior_definition', 286, 'cn', ''),
(2757, 'behavior_definition', 286, 'en', ''),
(2758, 'behavior_definition', 287, 'tw', '建立應有的品質標準及監測指標，以對服務品質的優劣進行自我鑑定；將服務品質結果進行分析、擬定品質改進方案，以進行改善。'),
(2759, 'behavior_definition', 287, 'cn', ''),
(2760, 'behavior_definition', 287, 'en', ''),
(2761, 'behavior_definition', 288, 'tw', '能積極參與「全員品質提昇活動」，利用各種品管手法，改進服務程序，以持續改善服務品質。'),
(2762, 'behavior_definition', 288, 'cn', ''),
(2763, 'behavior_definition', 288, 'en', ''),
(2764, 'behavior_definition', 289, 'tw', '為了完成重要的事情或有機會創造更高的績效表現，願意承擔新的工作任務、額外的公共事務或責任。'),
(2765, 'behavior_definition', 289, 'cn', ''),
(2766, 'behavior_definition', 289, 'en', ''),
(2767, 'behavior_definition', 290, 'tw', '能夠藉由執行院內的專案或部門單位內的工作，持續提升相關的知識及技能水準。'),
(2768, 'behavior_definition', 290, 'cn', ''),
(2769, 'behavior_definition', 290, 'en', ''),
(2770, 'behavior_definition', 291, 'tw', '避免「專業傲慢」，能持續主動的蒐集、觀察其他標竿醫院的典範或他人的工作方法，進行典範學習及持續自我改善。'),
(2771, 'behavior_definition', 291, 'cn', ''),
(2772, 'behavior_definition', 291, 'en', ''),
(2773, 'behavior_definition', 292, 'tw', '能運用腦力激盪等思考方法，蒐集、整合同仁或團隊的創新意見，簡化流程，以提高工作效率，超越期待。'),
(2774, 'behavior_definition', 292, 'cn', ''),
(2775, 'behavior_definition', 292, 'en', ''),
(2776, 'behavior_definition', 293, 'tw', '能夠規劃及採取適當的措施，如：塑造適當的環境，獎勵醫療研究及創新，不斷提昇醫療保健的專業技術，精進醫療品質，並鼓勵員工或其他想要超越自我的人，追求自我的突破。'),
(2777, 'behavior_definition', 293, 'cn', ''),
(2778, 'behavior_definition', 293, 'en', ''),
(2779, 'job_family_dsec', 12, 'tw', ''),
(2780, 'job_family_dsec', 12, 'cn', ''),
(2781, 'job_family_dsec', 12, 'en', ''),
(2782, 'job_family_dsec', 13, 'tw', ''),
(2783, 'job_family_dsec', 13, 'cn', ''),
(2784, 'job_family_dsec', 13, 'en', ''),
(2785, 'competency_dic_definition', 24, 'tw', '指能夠利用不同的媒介或方式，對他人或團體清楚的表達資訊或意見；在表達的過程中，能吸引他人的注意，使他人記住你所要表達的重點。'),
