(2793, 'competency_dic_definition', 26, 'en', ''),
(2794, 'competency_dic_definition', 27, 'tw', '指確認並了解議題、問題及機會；比較不同來源的資料並作出可行的方案以供選擇。'),
(2795, 'competency_dic_definition', 27, 'cn', ''),
(2796, 'competency_dic_definition', 27, 'en', ''),
(2797, 'competency_dic_definition', 28, 'tw', '確實遵循工作標準程序，注重工作細節，能運用回饋機制找出品質問題並進行改善，不斷提升工作品質。'),
