(2799, 'competency_dic_definition', 28, 'en', ''),
(2800, 'competency_dic_definition', 29, 'tw', '能針對各種情況調整管理風格與技巧，面對工作內容或環境的改變能夠，有效調整行為且維持應有的工作表現。'),
