(2845, 'course_desc', 95, 'tw', '1.如何運用溝通技巧對同事表達關懷、2.如何面對群眾表達善意、3.運用個人公關做好自我行銷、4.成為人際關係高手的成功心法--聆聽技巧演練、5.拓展職場人脈網絡的要訣-人脈關係拓展的障礙點、如何有效拓展人脈關係\r\n'),
