(2851, 'course_desc', 96, 'tw', '1.	以人際風格為基礎\r\n-認識五種行為風格\r\n-各種風格的主要行為特質\r\n-解讀自己的風格\r\n-解讀團隊的風格\r\n2.	增強人際互動的方法\r\n-不同風格屬性的關心重點\r\n-不同風格屬性的互動要領\r\n-風格互動演練\r\n3.	增強組織人際互動的方法\r\n-組織成員風格展現\r\n-組織成員風格互補\r\n-組織風格的優勢發揮與調整\r\n4.	人際網絡的建立\r\n-人際關係的法則\r\n-如何建立您的人脈關係\r\n-人際網絡關係的維持與應用\r\n'),
