(2857, 'course_desc', 97, 'tw', '1.	服務稽核與管理：\r\n-做好服務的「計畫」\r\n-做好服務的「執行」\r\n-做好服務的「分析」\r\n-做好服務的「改善」\r\n2.	顧客滿意度的衡量與分析\r\n3.	顧客服務品質管理\r\n4.	顧客服務技巧的關鍵'),
