(2863, 'course_desc', 98, 'tw', '1.	企業「顧客滿意經營」的服務價值\r\n2.	顧客滿意經營的文化塑造\r\n3.	服務氣氛營造及服務品質建立\r\n4.	對顧客服務同理心的培養與運用\r\n5.	對顧客服務敏感度的養成\r\n6.	服務文化的教導與傳承'),
