(2869, 'course_desc', 99, 'tw', '1.	成功完成目標的意義與價值\r\n2.	問題背後的問題－學習用什麽方法來確認問題\r\n3.	如何與團隊成員一起設定目標\r\n4.	學習用於收集和修改解決方案的工具和方法\r\n5.	規劃解決方案的實施步驟練習\r\n6.	跨團隊合作執行的管控技巧\r\n7.	七個步驟成功完成任務的方法\r\n8.	跨團隊合作執行結果的檢視與確認'),
