(2875, 'course_desc', 100, 'tw', '1.	團隊精神與工作團隊協作能力\r\n-何謂團隊精神及其客觀需求與發展情勢\r\n-工作團隊的協作能力\r\n2.	團隊要件與運作型態\r\n-團隊動力的形成要件\r\n-高績效團隊的運作型態\r\n3.	團隊領導與共同力量之發揮\r\n-團隊領導的特質與必備客觀條件\r\n-活化團隊力量的「心」與「力」\r\n4.	團隊的共同意志與互動協作方式\r\n-不同屬性團隊的共同意志形成方式\r\n-團隊內與團隊間互動協作的可行方式'),
