(2881, 'course_desc', 101, 'tw', '1.	澄清目標與選擇方案 \r\n-如何制定目標 \r\n-決策目標要素為何 \r\n-如何決定評量的標準及方法 (決策條件規格表)\r\n-如何決定各項標準之權重\r\n『量』-標準衡量評核表\r\n-如何決定各項標準之評核\r\n『分』-方案權重評估\r\n2.	評估風險及制定決策 \r\n-風險評估考量的因素 \r\n-風險評估矩陣之案例 \r\n-利益與風險考量之決策\r\n3.	最適方案選擇分析評核 \r\n-目標的制定與聲明\r\n-目標計劃的規劃與展開\r\n-目標的承接與工作計畫的分派\r\n4.	計劃的執行與管控\r\n-如何授權以有利計劃的執行\r\n-檢視目標績效的衡量'),
