(2953, 'competency_dic_definition', 52, 'tw', '能為自己設定具挑戰性的工作目標並全力以赴，要求自己工作表現達到高標準，並不斷尋求突破。'),
(2954, 'competency_dic_definition', 52, 'cn', ''),
(2955, 'competency_dic_definition', 52, 'en', ''),
(2956, 'competency_dic_definition', 53, 'tw', '能針對部屬工作能力的不足之處，親自示範教學，提供練習應用的機會，同時發揮部屬的潛力，持續追蹤並適時給予回饋。'),
(2957, 'competency_dic_definition', 53, 'cn', ''),
(2958, 'competency_dic_definition', 53, 'en', ''),
(2959, 'competency_dic_definition', 54, 'tw', '主動藉由多重管道促進學習能力，以促進領導或工作能力，並願意應用所學貢獻於醫院者。'),
(2960, 'competency_dic_definition', 54, 'cn', ''),
(2961, 'competency_dic_definition', 54, 'en', ''),
(2962, 'competency_dic_definition', 55, 'tw', '能視談話對象有條理的清楚表達想法，並可正確解讀、回應他人所傳達的訊息。'),
(2963, 'competency_dic_definition', 55, 'cn', ''),
(2964, 'competency_dic_definition', 55, 'en', ''),
(2965, 'competency_dic_definition', 56, 'tw', '重視次序、品質與正確性。能以監控、持續追蹤等行動，降低不確定性，維持正常運作功能及服務的品質和順序。'),
(2966, 'competency_dic_definition', 56, 'cn', ''),
(2967, 'competency_dic_definition', 56, 'en', ''),
(2968, 'competency_dic_definition', 57, 'tw', '與他人通力合作，成為團隊一部份，彼此互相溝通協助，以解決問題或完成計畫，一起工作，而非分開工作或互相競爭。'),
(2969, 'competency_dic_definition', 57, 'cn', ''),
(2970, 'competency_dic_definition', 57, 'en', ''),
(2971, 'competency_dic_definition', 58, 'tw', '會有效建立工作場合中與其他人員的關係；且對於組織中人際間衝突，會予以防範與化解行動。'),
(2972, 'competency_dic_definition', 58, 'cn', ''),
(2973, 'competency_dic_definition', 58, 'en', ''),
(2974, 'competency_dic_definition', 59, 'tw', '能夠正確辦識團隊文化及瞭解個別成員的能力與特性，運用適當且具有彈性的互動模式，激勵及指引團隊成功地完成任務。'),
(2975, 'competency_dic_definition', 59, 'cn', ''),
(2976, 'competency_dic_definition', 59, 'en', ''),
(2977, 'competency_dic_definition', 60, 'tw', '面對工作挑戰及困難時，能保持活力及正面的態度；讓員工看到未來成功的藍圖。'),
(2978, 'competency_dic_definition', 60, 'cn', ''),
(2979, 'competency_dic_definition', 60, 'en', ''),
(2980, 'competency_dic_definition', 61, 'tw', '會運用方法來鼓勵工作夥伴或部屬，並以積極與熱誠的態度協助同伴完成工作目標。'),
(2981, 'competency_dic_definition', 61, 'cn', ''),
(2982, 'competency_dic_definition', 61, 'en', ''),
(2983, 'competency_dic_definition', 62, 'tw', '能使用適當的人際關係和技巧來讓他人接受你的意見或計劃；修正個人的行為以順應不同的任務、情況和其他的人。'),
(2984, 'competency_dic_definition', 62, 'cn', ''),
(2985, 'competency_dic_definition', 62, 'en', ''),
