(3838, 'competency_definition', 141, 'tw', '貼切了解他人的感受、需要和觀點，並能清楚表達自己的語意讓對方明瞭；具備對上下與同儕之間的工作說明以達成團體合作結果的能力，過程中能做出適當反應。'),
(3839, 'competency_definition', 141, 'cn', ''),
(3840, 'competency_definition', 141, 'en', ''),
(3841, 'behavior_definition', 294, 'tw', '能耐心聆聽部屬或顧客抱怨，以同理心不與人發生衝突，改善人際關係。'),
(3842, 'behavior_definition', 294, 'cn', ''),
(3843, 'behavior_definition', 294, 'en', ''),
(3844, 'behavior_definition', 295, 'tw', '充分瞭解並正確解讀，明確回應他人所傳達的訊息並取得雙方共識。'),
(3845, 'behavior_definition', 295, 'cn', ''),
(3846, 'behavior_definition', 295, 'en', ''),
(3847, 'behavior_definition', 296, 'tw', '不先入為主，視不同狀況調整溝通技巧，傾聽並接受別人意見能站在對方立場，以同理心與對方展開良性互動。'),
(3848, 'behavior_definition', 296, 'cn', ''),
(3849, 'behavior_definition', 296, 'en', ''),
(3850, 'behavior_definition', 297, 'tw', '會運用各種不同工具(統計數據、圖表、簡報檔或適當實例的舉出等)，清楚表達訊息予傳達對象，讓對方明瞭。'),
(3851, 'behavior_definition', 297, 'cn', ''),
(3852, 'behavior_definition', 297, 'en', ''),
(3853, 'behavior_definition', 298, 'tw', '能協調、調動任務執行所需的資源，並分析溝通重點的優劣，提出令雙方同意的解決方案，並支持、追蹤以圓滿完成後續的工作任務。'),
(3854, 'behavior_definition', 298, 'cn', ''),
(3855, 'behavior_definition', 298, 'en', ''),
(3856, 'competency_definition', 142, 'tw', '協調部屬/同事間與自己不同的意見，並主動拓展與維繫組織有關的人際網絡。'),
(3857, 'competency_definition', 142, 'cn', ''),
(3858, 'competency_definition', 142, 'en', ''),
(3859, 'behavior_definition', 299, 'tw', '在工作上能夠與他人進行必要的接觸與關係維持，並明確表達自己的友好和善意互動。'),
(3860, 'behavior_definition', 299, 'cn', ''),
(3861, 'behavior_definition', 299, 'en', ''),
(3862, 'behavior_definition', 300, 'tw', '能建立工作所需之良好人際關係網絡，並能與不同部門的同仁合作共事。'),
(3863, 'behavior_definition', 300, 'cn', ''),
(3864, 'behavior_definition', 300, 'en', ''),
(3865, 'behavior_definition', 301, 'tw', '遇到困難時，能主動尋求有助於改善工作的人際網絡，並能維繫長期合作關係。'),
(3866, 'behavior_definition', 301, 'cn', ''),
(3867, 'behavior_definition', 301, 'en', ''),
(3868, 'behavior_definition', 302, 'tw', '對於工作同仁的個性、家庭或生活有基本的關心跟了解。'),
(3869, 'behavior_definition', 302, 'cn', ''),
(3870, 'behavior_definition', 302, 'en', ''),
(3871, 'behavior_definition', 303, 'tw', '能積極、主動經營對工作有益的人際網絡關係。'),
(3872, 'behavior_definition', 303, 'cn', ''),
(3873, 'behavior_definition', 303, 'en', ''),
(3874, 'competency_definition', 143, 'tw', '蒐集、整合運用各種資料，以統計工具或經驗，針對議題組織化、系統化分析，主動提出創新的建議進行規畫執行。'),
(3875, 'competency_definition', 143, 'cn', ''),
(3876, 'competency_definition', 143, 'en', ''),
(3877, 'behavior_definition', 304, 'tw', '能針對實際狀況加以設想，發展出跟以往工作方式不同的新方法來突破、改善現狀。'),
(3878, 'behavior_definition', 304, 'cn', ''),
(3879, 'behavior_definition', 304, 'en', ''),
(3880, 'behavior_definition', 305, 'tw', '能夠利用各種可能促進創意的技術，如小組討論法、腦力激盪法、經驗分享等，協助個人或團體產生其他更好的產品創意和處理模式。'),
(3881, 'behavior_definition', 305, 'cn', ''),
(3882, 'behavior_definition', 305, 'en', ''),
(3883, 'behavior_definition', 306, 'tw', '平時就會留意一些新奇的概念或看法，並且在遇到狀況時，運用這些與眾不同的觀念解決問題。'),
(3884, 'behavior_definition', 306, 'cn', ''),
(3885, 'behavior_definition', 306, 'en', ''),
(3886, 'behavior_definition', 307, 'tw', '能綜合別人的意見及看法，創造出全新的概念。'),
(3887, 'behavior_definition', 307, 'cn', ''),
(3888, 'behavior_definition', 307, 'en', ''),
(3889, 'behavior_definition', 308, 'tw', '能夠主動發覺問題、尋找各種創意來源，創造出新的解決方案及各種創意。'),
(3890, 'behavior_definition', 308, 'cn', ''),
(3891, 'behavior_definition', 308, 'en', ''),
(3892, 'competency_definition', 144, 'tw', '依部屬工作及職責，說明授權範圍並尊重部屬所做決定，督導其工作及實施的方法，以審視部屬業務執行的成效。'),
(3893, 'competency_definition', 144, 'cn', ''),
(3894, 'competency_definition', 144, 'en', ''),
(3895, 'behavior_definition', 309, 'tw', '了解部屬的職務內容與工作重點，以督導部屬工作的成效。'),
(3896, 'behavior_definition', 309, 'cn', ''),
(3897, 'behavior_definition', 309, 'en', ''),
(3898, 'behavior_definition', 310, 'tw', '讓部屬知道主管用什麼標準來督導他們的工作表現，並且能夠依據實際的情況及部屬的反應，調整控管的方法。'),
(3899, 'behavior_definition', 310, 'cn', ''),
(3900, 'behavior_definition', 310, 'en', ''),
(3901, 'behavior_definition', 311, 'tw', '培養員工自我管理的能力，容許其犯錯，透過改善，朝目標努力實現。'),
(3902, 'behavior_definition', 311, 'cn', ''),
(3903, 'behavior_definition', 311, 'en', ''),
(3904, 'behavior_definition', 312, 'tw', '由公司的長期利益出發，透過督導機制，讓部門人員工作的成效調整符合組織未來發展需求。'),
(3905, 'behavior_definition', 312, 'cn', ''),
(3906, 'behavior_definition', 312, 'en', ''),
(3907, 'behavior_definition', 313, 'tw', '除了正式文件的規定外，還能夠依主管的專業技能來督導部屬工作上的表現，以符合公司最終利益。'),
(3908, 'behavior_definition', 313, 'cn', ''),
(3909, 'behavior_definition', 313, 'en', ''),
(3910, 'competency_definition', 145, 'tw', '能針對部屬工作能力的不足之處，提供培訓與諮詢，以激發部屬的潛力，並適時給予指導。'),
(3911, 'competency_definition', 145, 'cn', ''),
(3912, 'competency_definition', 145, 'en', ''),
(3913, 'competency_definition', 146, 'tw', '能針對部屬工作能力的不足之處，提供培訓與諮詢，以激發部屬的潛力，並適時給予指導。'),
(3914, 'competency_definition', 146, 'cn', ''),
(3915, 'competency_definition', 146, 'en', ''),
(3916, 'behavior_definition', 314, 'tw', '能因材施教、激發部屬潛力，培育有助於組織發展的部屬。'),
(3917, 'behavior_definition', 314, 'cn', ''),
(3918, 'behavior_definition', 314, 'en', ''),
(3919, 'behavior_definition', 315, 'tw', '依據目前單位的發展能夠有計劃、持續的提供機會給部屬進行工作歷練的指導與建議。'),
(3920, 'behavior_definition', 315, 'cn', ''),
(3921, 'behavior_definition', 315, 'en', ''),
(3922, 'behavior_definition', 316, 'tw', '能清楚知道部屬其自身的優缺點，傾聽部屬的發展需求，擬訂合適的職涯發展方向，並安排長期的指導或訓練。'),
(3923, 'behavior_definition', 316, 'cn', ''),
(3924, 'behavior_definition', 316, 'en', ''),
(3925, 'behavior_definition', 317, 'tw', '能夠主動瞭解部屬的工作進度是否遭遇到困難或需要資源的協助。'),
(3926, 'behavior_definition', 317, 'cn', ''),
(3927, 'behavior_definition', 317, 'en', ''),
(3928, 'behavior_definition', 318, 'tw', '協助部屬分析/評估可能遇到的困難，並願意提供部屬詳細的指導與諮詢。'),
(3929, 'behavior_definition', 318, 'cn', ''),
(3930, 'behavior_definition', 318, 'en', ''),
(3931, 'competency_definition', 147, 'tw', '能夠理性分析問題，有效的整合運用所獲得的各種資訊，尋求根本原因並提出有效的解決方式及預防措施。'),
(3932, 'competency_definition', 147, 'cn', ''),
(3933, 'competency_definition', 147, 'en', ''),
(3934, 'behavior_definition', 319, 'tw', '能夠分辨問題的重要性與優先順序，在解決問題時能整合不同來源的資料，分析出問題的多重關係，建立解決問題的知識以及可依循的問題解決模式。'),
(3935, 'behavior_definition', 319, 'cn', ''),
(3936, 'behavior_definition', 319, 'en', ''),
(3937, 'behavior_definition', 320, 'tw', '對於較複雜要素所構成的問題，能找出解決的方法及行動計劃步驟，做出最適合的解決方案及預防措施。'),
(3940, 'behavior_definition', 321, 'tw', '樂於接受新穎的觀念、方法及新的資訊，不受限於特定領域之習慣想法與做法，並提出具體可行的解決方案。'),
(3938, 'behavior_definition', 320, 'cn', ''),
(3939, 'behavior_definition', 320, 'en', ''),
(3941, 'behavior_definition', 321, 'cn', ''),
(3942, 'behavior_definition', 321, 'en', ''),
(3943, 'behavior_definition', 322, 'tw', '能針對自身決策範圍內的問題或機會，提出多項可行方案，進行評估分析以找出最佳的解決方法。'),
(3944, 'behavior_definition', 322, 'cn', ''),
(3945, 'behavior_definition', 322, 'en', ''),
(3946, 'behavior_definition', 323, 'tw', '能預測到問題的障礙及可能發生的結果，以進行問題預防發生的風險管控措施。'),
(3947, 'behavior_definition', 323, 'cn', ''),
(3948, 'behavior_definition', 323, 'en', ''),
(3949, 'competency_definition', 148, 'tw', '有效管理時間和運用公司資源，監督控管並持續追蹤進度，以確保時效內，達成公司目標。'),
(3950, 'competency_definition', 148, 'cn', ''),
(3951, 'competency_definition', 148, 'en', ''),
(3952, 'behavior_definition', 324, 'tw', '事先進行工作規劃，透過標準作業流程執行工作，達成工作進度確保任務品質與控制成本。'),
(3953, 'behavior_definition', 324, 'cn', ''),
(3954, 'behavior_definition', 324, 'en', ''),
(3955, 'behavior_definition', 325, 'tw', '能將計畫展開與工作分配，掌握好每個關鍵的執行檢核點，以確保工作方向與內容的正確性。'),
(3956, 'behavior_definition', 325, 'cn', ''),
(3957, 'behavior_definition', 325, 'en', ''),
(3958, 'behavior_definition', 326, 'tw', '計畫發生變化時能事先擬定應對策略及行動方案，確保各計畫的正常運作。'),
(3959, 'behavior_definition', 326, 'cn', ''),
(3960, 'behavior_definition', 326, 'en', ''),
(3961, 'behavior_definition', 327, 'tw', '當進度落後或遇到困難時，會立即發出警訊，並尋求相關資源與協助以解決困難，確保在預定時間內完成工作任務。'),
(3962, 'behavior_definition', 327, 'cn', ''),
(3963, 'behavior_definition', 327, 'en', ''),
(3964, 'behavior_definition', 328, 'tw', '能使單位中的成員瞭解成功執行的重要性，並注意執行的過程與方法是否達到預期的效率與效益。'),
(3965, 'behavior_definition', 328, 'cn', ''),
(3966, 'behavior_definition', 328, 'en', ''),
(3967, 'ability_def', 160, 'tw', '檢定或經驗具下列至少一項：a.參與模組導入經驗、b.顧問認證合格、c.內訓通過檢定'),
(3968, 'ability_def', 160, 'cn', ''),
(3969, 'ability_def', 160, 'en', '');
INSERT INTO `tpl` (`tpl_id`, `tpl_title`, `tpl_sender`, `tpl_content`, `tpl_trigger`) VALUES
(3, '360度職能評鑑通知函 (評鑑期限即將到期)', '360 Degree Assessment Administrator', '親愛的 {fullName}您好：\r\n\r\n由於您還有職能評鑑問卷尚未完成，且評鑑期限即將到期(oo月oo日 星期X)，請您儘快撥空登入 {sysURL} 填寫問卷，謝謝您！\r\n\r\n您的登入信息如下：\r\n帳號：{user_account} \r\n密碼：{password}\r\n\r\n請注意：當您填寫問卷過程中需暫時離開系統時，請務必點選暫存，以免數據遺失）\r\n\r\n若您在填寫問卷過程當中有任何問題，請洽人資室 崔懷芝。\r\n\r\n謝謝您的參與！\r\n\r\n主管領導力提升專案工作小組 敬上', ''),
(2, '360度職能評鑑邀請函', '360 Degree Assessment Administrator', '親愛的{fullName}您好：\r\n\r\n在您收到這封郵件時，表示您已被邀請參與本次管理職能360度評鑑。\r\n\r\n本次評鑑目的是為了給參與本次評鑑的受評人，提供更明確的管理職能回饋訊息，俾便受評人建立更具針對性的個人發展計畫(IDP)。\r\n\r\n您的真實回饋訊息，對受評人建立IDP至關重要，請依據您日常對受評人的實際觀察，提供客觀、真實的反饋。\r\n\r\n您至少有一份以上的問卷尚待填寫，請登入 {sysURL}填寫問卷，並請您務必在oo月oo日(星期X)下班前，將所有評鑑問卷填寫完畢。\r\n\r\n您的登入信息如下：\r\n帳號：{user_account}\r\n密碼：{password}\r\n\r\n請注意：當您填寫問卷過程中需暫時離開系統時，請務必點選暫存，以免數據遺失）\r\n\r\n若您在填寫問卷過程當中有任何問題，請洽人資室 崔懷芝。\r\n\r\n謝謝您的參與！\r\n\r\n主管領導力提升專案工作小組 敬上', '');
